#include <vector>
#include <set>
#include <algorithm>

using namespace std;

class Solution {
public:
    vector<int> leftmostBuildingQueries(vector<int>& heights, vector<vector<int>>& queries) {
        int n = heights.size();
        vector<int> answer(queries.size(), -1);
        set<pair<int, int>> heightWithIndex; // To store heights with their indices

        for (int i = 0; i < n; ++i) {
            heightWithIndex.insert({heights[i], i});
        }

        for (int i = 0; i < queries.size(); ++i) {
            int start = queries[i][0];
            int end = queries[i][1];
            auto it = heightWithIndex.lower_bound({heights[start], start});
            // Ensure we start checking from the next building to 'start'
            if (it != heightWithIndex.end()) {
                ++it;
            }
            for (; it != heightWithIndex.end(); ++it) {
                int buildingIndex = it->second;
                if (buildingIndex > start && buildingIndex <= end && heights[buildingIndex] > heights[start] && heights[buildingIndex] > heights[end]) {
                    answer[i] = buildingIndex;
                    break;
                }
                if (buildingIndex > end) {
                    break;
                }
            }
        }

        return answer;
    }
};
